import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Open Product Detail Modal by clicking on the "Shop now" button
    await page.waitForSelector('.cta-button', { timeout: 5000 });
    await page.click('.cta-button');

    // Take screenshot after opening the modal
    await page.waitForSelector('.product-detail', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_modal_opened.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_modal_opened.png'));

    // Extract product title from the modal
    const productTitle = await page.$eval('.product-detail-title', el => el.textContent.trim());

    return {
      success: true,
      action: "Opened product detail modal and extracted product title",
      extractedData: { productTitle },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
